/* Procedure structure for procedure `proc_studentlist_result` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_studentlist_result` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `proc_studentlist_result`(vkey varchar(50))
BEGIN
	SELECT
	a.student_id,
	b.StudLName, b.StudFName, b.StudMName, c.EnrCourse, c.EnrYear,
	(
		COALESCE((SELECT SUM(questions.score) FROM answers JOIN `options` ON answers.option_id = options.option_id
		JOIN answer_sheets ON answers.answer_sheet_id = answer_sheets.answer_sheet_id
		JOIN questions ON options.question_id = questions.question_id
		WHERE questions.section_id = 1 AND answer_sheets.code = '202'
		AND answer_sheets.student_id = a.student_id AND options.is_answer = 1), 0)
	) AS 'abstraction',
	(
		COALESCE((SELECT SUM(questions.score) FROM answers JOIN `options` ON answers.option_id = options.option_id
		JOIN answer_sheets ON answers.answer_sheet_id = answer_sheets.answer_sheet_id
		JOIN questions ON options.question_id = questions.question_id
		WHERE questions.section_id = 2 AND answer_sheets.code = '202'
		AND answer_sheets.student_id = a.student_id AND options.is_answer = 1), 0)
	) AS 'logical',
	(
		COALESCE((SELECT SUM(questions.score) FROM answers JOIN `options` ON answers.option_id = options.option_id
		JOIN answer_sheets ON answers.answer_sheet_id = answer_sheets.answer_sheet_id
		JOIN questions ON options.question_id = questions.question_id
		WHERE questions.section_id = 3 AND answer_sheets.code = '202'
		AND answer_sheets.student_id = a.student_id AND options.is_answer = 1), 0)
	) AS 'english',
	(
		COALESCE((SELECT SUM(questions.score) FROM answers JOIN `options` ON answers.option_id = options.option_id
		JOIN answer_sheets ON answers.answer_sheet_id = answer_sheets.answer_sheet_id
		JOIN questions ON options.question_id = questions.question_id
		WHERE questions.section_id = 4 AND answer_sheets.code = '202'
		AND answer_sheets.student_id = a.student_id AND options.is_answer = 1), 0)
	) AS 'numerical',
	(
		COALESCE((SELECT SUM(questions.score) FROM answers JOIN `options` ON answers.option_id = options.option_id
		JOIN answer_sheets ON answers.answer_sheet_id = answer_sheets.answer_sheet_id
		JOIN questions ON options.question_id = questions.question_id
		WHERE questions.section_id = 5 AND answer_sheets.code = '202'
		AND answer_sheets.student_id = a.student_id AND options.is_answer = 1), 0)
	) AS 'general'
	FROM
	pretest.answer_sheets a
	JOIN registrar_gadtc.tblstudhinfo b ON a.student_id = b.StudID
	JOIN registrar_gadtc.tblenr202 c ON b.StudID = c.EnrIDNum
	WHERE b.StudLName like CONCAT(vkey, '%') OR b.StudFName like CONCAT(vkey, '%') OR b.StudID like CONCAT(vkey, '%');
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_student_result` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_student_result` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_student_result`(vstudent_id varchar(20), vcode varchar(20))
BEGIN
    
	SELECT
		a.section_id,
		a.section,
		COALESCE(
		(
			SELECT SUM(questions.score) FROM answers JOIN `options` ON answers.option_id = options.option_id
			JOIN answer_sheets ON answers.answer_sheet_id = answer_sheets.answer_sheet_id
			JOIN questions ON options.question_id = questions.question_id
			WHERE questions.section_id = a.section_id AND answer_sheets.code = vcode
			AND answer_sheets.student_id = vstudent_id AND options.is_answer = 1
			
		), 0) AS total_score
	FROM
		sections a;
    END */$$
DELIMITER ;

